oxy_webhelp_navlinks = {"rsc_ahv_virtual_machines-d22872e18694":{"topics":[{"title":"AHV virtual machine protection","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides protection for AHV virtual machines either by         individually assigning the virtual machine to an SLA Domain or through automatic         protection.<\/p>","href":"nutanix_ahv\/ahv_vm_protection.html","attributes":{"data-id":"ahv_vm_protection"},"menu":{"hasChildren":false},"tocID":"ahv_vm_protection-d22872e18707","next":"ahv_vm_protection-d22872e18707"},{"title":"Nutanix Cloud Clusters on AWS and Azure","shortdesc":"<p class=\"shortdesc\">Nutanix NC2 provides a platform for running applications in public clouds and for         extending your on-premises Nutanix infrastructure in AWS and Azure. With <span class=\"ph\">RSC<\/span>, you can protect Nutanix NC2 workloads on AWS and Azure.<\/p>","href":"nutanix_ahv\/ahv_nc2_on_aws_and_azure.html","attributes":{"data-id":"ahv_nc2_on_aws_and_azure"},"menu":{"hasChildren":false},"tocID":"ahv_nc2_on_aws_and_azure-d22872e18742","topics":[]},{"title":"Disaster Recovery support for Nutanix Prism Central","shortdesc":"<p class=\"shortdesc\">Disaster Recovery for Nutanix Prism Central ensures uninterrupted protection of the         AHV virtual machines during a planned failover.<\/p>","href":"nutanix_ahv\/ahv_dr_support_prism_central.html","attributes":{"data-id":"ahv_dr_support_prism_central"},"menu":{"hasChildren":false},"tocID":"ahv_dr_support_prism_central-d22872e18756","topics":[]},{"title":"Addition of Nutanix clusters to <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">By adding Nutanix clusters, Nutanix Cloud Clusters (NC2), or Nutanix Prism Central to             <span class=\"ph\">RSC<\/span>, you can protect the AHV virtual machines deployed on Nutanix         clusters or NC2.<\/p>","href":"nutanix_ahv\/ahv_addition_nx_cluster_to_rsc.html","attributes":{"data-id":"ahv_addition_nx_cluster_to_rsc"},"menu":{"hasChildren":false},"tocID":"ahv_addition_nx_cluster_to_rsc-d22872e18767","next":"ahv_addition_nx_cluster_to_rsc-d22872e18767"},{"title":"AHV virtual machine protection","shortdesc":"<p class=\"shortdesc\">SLA Domains can be used to apply the data protection policies to an individual         virtual machine or a selected set of virtual machines.<\/p>","href":"nutanix_ahv\/ahv_virtual_machine_protection.html","attributes":{"data-id":"ahv_virtual_machine_protection"},"menu":{"hasChildren":false},"tocID":"ahv_virtual_machine_protection-d22872e18908","next":"ahv_virtual_machine_protection-d22872e18908"},{"title":"Excluding AHV virtual machine disk files","shortdesc":"<p class=\"shortdesc\">Exclude specific managed disks while protecting other managed disks attached to a         virtual machine instance.<\/p>","href":"nutanix_ahv\/ahv_excluding_vm_disks.html","attributes":{"data-id":"ahv_excluding_vm_disks"},"menu":{"hasChildren":false},"tocID":"ahv_excluding_vm_disks-d22872e18985","topics":[]},{"title":"AHV virtual machine scripts","shortdesc":"<p class=\"shortdesc\">You can configure the Rubrik cluster to run scripts on a guest OS before creating a         snapshot, after creating a snapshot, and after the Rubrik cluster completes the backup         process.<\/p>","href":"cdm\/ahv_virtual_machine_scripts.html","attributes":{"data-id":"ahv_virtual_machine_scripts"},"menu":{"hasChildren":false},"tocID":"ahv_virtual_machine_scripts-d22872e18996","next":"ahv_virtual_machine_scripts-d22872e18996"},{"title":"Rubrik Backup Service installation for AHV","shortdesc":"<p class=\"shortdesc\">The Rubrik Backup Service is a software installed on a host that coordinates activity         between the Rubrik cluster and the host.<\/p>","href":"nutanix_ahv\/ahv_rbs_installation.html","attributes":{"data-id":"ahv_rbs_installation"},"menu":{"hasChildren":false},"tocID":"ahv_rbs_installation-d22872e19032","next":"ahv_rbs_installation-d22872e19032"},{"title":"Network segmentation on Nutanix clusters","shortdesc":"<p class=\"shortdesc\">Rubrik supports AHV virtual machine backup from Nutanix clusters that have network         segmentation enabled.<\/p>","href":"cdm\/ahv_network_segmentation_on_nutanix_clusters.html","attributes":{"data-id":"ahv_network_segmentation_on_nutanix_clusters"},"menu":{"hasChildren":false},"tocID":"ahv_network_segmentation_on_nutanix_clusters-d22872e19057","next":"ahv_network_segmentation_on_nutanix_clusters-d22872e19057"},{"title":"AHV snapshot consistency","shortdesc":"<p class=\"shortdesc\">With the AHV snapshot consistency feature, you can select the type of snapshot you         want <span class=\"ph\">RSC<\/span>to take. Depending on your specific requirements, <span class=\"ph\">RSC<\/span>can take either application-consistent snapshots or crash-consistent         snapshots.<\/p>","href":"nutanix_ahv\/ahv_snapshot_consistency.html","attributes":{"data-id":"ahv_snapshot_consistency"},"menu":{"hasChildren":false},"tocID":"ahv_snapshot_consistency-d22872e19090","next":"ahv_snapshot_consistency-d22872e19090"},{"title":"On-demand snapshots of AHV virtual machines","shortdesc":"<p class=\"shortdesc\">In addition to policy-based snapshots, you can create AHV virtual machine snapshots         by using the on-demand snapshot process.<\/p>","href":"nutanix_ahv\/ahv_ods.html","attributes":{"data-id":"ahv_ods"},"menu":{"hasChildren":false},"tocID":"ahv_ods-d22872e19136","next":"ahv_ods-d22872e19136"},{"title":"Local host page for AHV virtual machine","shortdesc":"<p class=\"shortdesc\">The local host page provides detailed information about the virtual machine,         protection of the virtual machine, available snapshots, and tasks related to the virtual         machine and snapshots.<\/p>","href":"nutanix_ahv\/ahv_local_host_page.html","attributes":{"data-id":"ahv_local_host_page"},"menu":{"hasChildren":false},"tocID":"ahv_local_host_page-d22872e19158","next":"ahv_local_host_page-d22872e19158"},{"title":"Recovery of AHV virtual machines","shortdesc":"<p class=\"shortdesc\">You can recover an AHV virtual machine or specific disks within a virtual machine         from snapshots that are locally available on a Rubrik cluster.<\/p>","href":"nutanix_ahv\/ahv_vm_recovery.html","attributes":{"data-id":"ahv_vm_recovery"},"menu":{"hasChildren":false},"tocID":"ahv_vm_recovery-d22872e19257","next":"ahv_vm_recovery-d22872e19257"}]}};